</template>



<script>
const interact = require('interactjs')
import anime from 'animejs/lib/anime.es.js';
import {throttle} from 'lodash';

export default {
    name: 'LissajousCircuit',
    components: {
    //   LissajousCircuitSVG,
    },
    data() {
        return  {
            slider: {
                xMin: 231.274, 
                xMax: 431.274,
                xDiff: 200,
                snapDist: 25,
                sliderPos: {
                    x: 340.274,
                    y: 296.3241,    
                },
            },
            resistors: {
                currentResInitial: {
                    x: 81.4564,
                    y: 377.1111
                },
                draggedResInitial: {
                    x: 0,
                    y: 0
                },
                posArray: [
                    { // 1k Resistor start in slot
                        x: 0,
                        y: 0
                    },
                    {   // 1.5k Resistor
                        x: 121.6564,
                        y: 377.1111
                    },
                    {   // 2.2k Resistor
                        x: 161.7564,
                        y: 377.1111
                    },
                    {   // 3.3k Resistor
                        x: 201.9564,
                        y: 377.1111
                    },
                    {   // 4.7k Resistor
                        x: 242.1564,
                        y: 377.1111
                    },
                    {   // 6.8k Resistor
                        x: 282.3564,
                        y: 377.1111
                    },
                    {   // 10k Resistor
                        x: 322.5564,
                        y: 377.1111
                    },
                    {   // 15k Resistor
                        x: 362.6564,
                        y: 377.1111
                    },
                ],
                swapped: false,
            },
            switches: [
                { // Digital Switch
                    on: true,
                },
                { // Analog Switch
                    on: true,
                }
            ],
            lissajous: {
                numPaths: 35,
                numPoints: 200,
                amplitude1: 70,
                amplitude2: 55,
                x: 95,
                y: 75,
                polygon: null,
                duration: 5000,
            },
            freq1: 1,
            freq2: 5,
            path: [],
            root: null,
            rootMatrix: null
        }
    },
    watch: {
        freq1: function(newVal, oldVal) {
            this.debouncedGetSine();
        },
        freq2: function(newVal, oldVal) {
            this.debouncedGetSine();
        }
    },
    methods: {
        sliderOnMove: function (event) {
            this.rootMatrix = this.root.getScreenCTM();

            var pointX = event.target.x.baseVal.value;
            pointX += event.dx / this.rootMatrix.a;
            if (pointX > this.slider.xMax) {
                pointX = this.slider.xMax;
            }
            if (pointX < this.slider.xMin) {
                pointX = this.slider.xMin;
            }
            this.slider.sliderPos.x = pointX;

            var newFreq = Math.ceil((pointX - this.slider.xMin) / (this.slider.xDiff / this.resistors.posArray.length));
            if (newFreq === 0) {
                this.freq2 = 1;
            }
            else {
                this.freq2 = newFreq;
            }
        },
        dragMoveListener: function (event) {
            var target = event.target
            // keep the dragged position in the data-x/data-y attributes
            var x = (parseFloat(target.getAttribute('x')) || 0) + (event.dx / this.rootMatrix.a)
            var y = (parseFloat(target.getAttribute('y')) || 0) + (event.dy / this.rootMatrix.d)


            // update the posiion attributes
            // target.setAttribute('x', x)
            // target.setAttribute('y', y)
            this.resistors.posArray[event.target.dataset.index].x = x;
            this.resistors.posArray[event.target.dataset.index].y = y;
        },
        swapResistors: function (event) {
            // remove existing resistor
            var oldCurrentResistor = event.target.firstChild;
            event.target.removeChild(oldCurrentResistor);
            event.target.parentElement.appendChild(oldCurrentResistor);

            this.resistors.posArray[oldCurrentResistor.dataset.index].x = this.resistors.currentResInitial.x;
            this.resistors.posArray[oldCurrentResistor.dataset.index].y = this.resistors.currentResInitial.y;

            oldCurrentResistor.classList.add("draggable");
            oldCurrentResistor.classList.remove("currentResistor");

            // add new resistor
            var newCurrentResistor = event.relatedTarget;
            this.resistors.currentResInitial.x = this.resistors.draggedResInitial.x;
            this.resistors.currentResInitial.y = this.resistors.draggedResInitial.y;

            this.resistors.posArray[newCurrentResistor.dataset.index].x = 0;
            this.resistors.posArray[newCurrentResistor.dataset.index].y = 0;

            event.target.parentElement.removeChild(newCurrentResistor);
            event.target.appendChild(newCurrentResistor);
            event.target.dataset.resistor = newCurrentResistor.dataset.index;

            newCurrentResistor.classList.remove("draggable");
            newCurrentResistor.classList.add("currentResistor");

            this.freq1 = Number(newCurrentResistor.dataset.index) + 1;

            // duplicate resistor R2
            var duplicateHolder = event.target.nextElementSibling;
            duplicateHolder.removeChild(duplicateHolder.firstChild);
            var duplicate = newCurrentResistor.cloneNode(true);
            duplicate.id = duplicate.id + '_duplicate';
            duplicate.classList.remove("currentResistor");
            duplicate.x.baseVal.value = 0;
            duplicate.y.baseVal.value = 0;
            duplicateHolder.appendChild(duplicate);

            this.resistors.swapped = true;
        },
        resistorLeft: function (event) {
            this.resistors.draggedResInitial.x = this.resistors.posArray[event.relatedTarget.dataset.index].x;
            this.resistors.draggedResInitial.y = this.resistors.posArray[event.relatedTarget.dataset.index].y;
            this.resistors.swapped = false;
        },
        resistorBack: function (event) {
            if (!this.resistors.swapped) {

                this.resistors.posArray[event.relatedTarget.dataset.index].x = this.resistors.draggedResInitial.x;
                this.resistors.posArray[event.relatedTarget.dataset.index].y = this.resistors.draggedResInitial.y;
            }
        },
        toggleSwitch: function (event) {
            
            var log = !this.switches[event.target.parentElement.dataset.index].on;
            console.log(log)
            this.switches[event.target.parentElement.dataset.index].on = log;
        },
        getSine: function () {
            var x,y
            var twopi = 2*Math.PI;
            for (var j = 0; j < this.lissajous.numPaths; j++){
                var points = []
                for (var i = 0; i < twopi; i+=(twopi/this.lissajous.numPoints))
                {
                    x= Math.sin(this.freq1*i) * this.lissajous.amplitude1 + this.lissajous.x;
                    y= Math.sin(this.freq2*i + (j*twopi/(this.lissajous.numPaths-1))) * this.lissajous.amplitude2 + this.lissajous.y;
                    points.push(x)
                    points.push(y)
                }
                this.path[j] = points.join(" ");
            }
            this.lissajous.polygon.setAttribute("points", this.path[0])
            this.path.shift()

            // update Lissajous animation
            anime({
                targets: '#sineWave',
                points: this.path,
                scale: 1,
                easing: 'linear',
                duration: this.lissajous.duration,
                // direction: 'alternate',
                loop: true
            });
            var duration1 = (1000/this.freq1)/2;
            var duration2 = (1000/this.freq2)/2;
            // update LED animation
            anime({ // Digital LED
                targets: '#digitalFilter',
                opacity: [0.4, 1.0],
                duration: duration2,
                direction: 'alternate',
                loop: true,
                easing: 'cubicBezier(0.445, 0.050, 0.550, 0.950)',
            });
            anime({ // Digital LED
                targets: '#analogFilter',
                opacity: [0.4, 1.0],
                duration: duration1,
                delay: function(el, i, l) {
                    // var newDelay = el.parentElement.dataset.delay;
                    // var numPaths = el.parentElement.dataset.numPaths;
                    // newDelay += (2*Math.PI/(numPaths-1)) % 2*Math.PI;
                    // return newDelay;
                    console.log('new delay')
                    return 0;
                },
                direction: 'alternate',
                loop: true,
                easing: 'cubicBezier(0.445, 0.050, 0.550, 0.950)',
            });
        }
    },
    computed: {

    },
    mounted() {
        console.clear()
        this.root = document.getElementById('LissajousCircuitSVG')
        this.rootMatrix = this.root.getScreenCTM();
        this.lissajous.polygon = document.getElementById('sineWave');


        // ------------------------ Set up Slider --------------
        interact('.slider')
            .draggable({
            onstart: () => {
                // this.root.setAttribute('class', 'dragging')
            },
            onmove: (evt) => {
                this.sliderOnMove(evt)
            },
            onend: () => {
                // this.root.setAttribute('class', '')
            },
            restrict: { restriction: 'parent' },
        });


        // ---------- Set up Resistors -------------------------------
        interact('.draggable')
        .draggable({
            inertia: false,
            modifiers: [
                interact.modifiers.restrictRect({
                    restriction: 'parent',
                    endOnly: true
                })
            ],
            autoScroll: true,
            onmove: (evt) => {
                this.dragMoveListener(evt)
            },
        });
        interact('.dropzone').dropzone({
            // only accept elements matching this CSS selector
            accept: '.draggable',
            // Require a 75% element overlap for a drop to be possible
            overlap: 0.25,

            // listen for drop related events:

            ondropactivate: (event) => {
                // add active dropzone feedback
                // console.log('ondropactivate: ')
                // console.log(event)
                this.resistorLeft(event);
            },
            ondragenter: (event) => {
                var draggableElement = event.relatedTarget
                var dropzoneElement = event.target

                // feedback the possibility of a drop
                // console.log('ondragenter: ')
                // console.log(event)
            },
            ondragleave: (event) => {
                // remove the drop feedback style
                // console.log('ondragleave: ')
                // console.log(event)
            },
            ondrop: (event) => {
                // put current resistor in
                // console.log('ondrop: ')
                // console.log(event)
                this.swapResistors(event);
            },
            ondropdeactivate: (event) => {
                // put current resistor back in original position
                // console.log(event)
                this.resistorBack(event);
            }
        });
        
        // ------ Set up Switches ------
        interact('.switch')
            .on('tap', (event) => {
                this.toggleSwitch(event);
                event.preventDefault();
            })
            .on('doubletap', (event) => {
                
                event.preventDefault();
            })
            .on('hold', (event) => {
                
        });

        // Lissajous Path and LEDs
        this.debouncedGetSine = _.throttle(this.getSine, 250, {leading:true, trailing:false});
        // this.debouncedGetSine();


        document.addEventListener('dragstart', (event) => {
            event.preventDefault();
        });
    }
}
</script>

